import React from 'react';
import Tiza from './../../FotosDeGeneros/Tiza.png';
import Aluminio from './backRespaldo.png';

export const colores = (nombre) =>{
    let color={
        'Tiza': Tiza,
        'Aluminio': Aluminio,
        // 'Stone': Stone,
        // 'Ceniza': Ceniza,
        // 'Grafito': Grafito,
        // 'Carbón': Carbón,
        // 'Negro': Negro,
        // 'Natural': Natural,
        // 'Niebla': Niebla,
        // 'Nougat': Nougat,
        // 'Madera': Madera,
        // 'Lila': Lila,
        // 'Pink': Pink,
        // 'Limón': Limón,
        // 'Agua': Agua,
        // 'Turquesa': Turquesa,
        // 'Blue': Blue,
        // 'Azul Lavado': AzulLavado,
        // 'Denim': Denim,
        // 'Marino': Marino,
        // 'Pimenton': Pimenton,
        // 'Lacre': Lacre,
        // 'Guinda': Guinda, 
        // 'Ginger': Ginger, 
        // 'Café': Café, 
        // 'Arena': Arena
    }
    return color[nombre];
}


export const LinoParis = (props) => {

    return <image href={colores(props.color)} x="0" y="0" width="20" height="20" />
}
